// *** COMEÇO DA FUNÇAO PARA OBTER AS CATEGORIAS DO SISTEMA *** //

function getCategory() {
  var obj = new Object();
  obj['categoria'] = ['Preto', 'Vermelho', 'Amarelo', 'Face', 'Placa'];

  var obj_json = JSON.stringify(obj);

  for (var i=0; i<obj.categoria.length; i++){
    var option = document.createElement("option");
    option.text = obj['categoria'][i];
    option.value = obj['categoria'][i];
    var select = document.getElementById("select_category");
    select.appendChild(option);
  }
}

