// *** LOGIN DA FUNÇÃO PARA REALIZAR O LOGIN *** //

function oauth2_login() {

    $.oauth2({
        auth_url: 'https://www.facebook.com/dialog/oauth',           // required
        response_type: 'token',      // required - "code"/"token"
        //token_url: '',          // required if response_type = 'code'
        //logout_url: '',         // recommended if available
        client_id: '429976794091330',          // required
        //client_secret: '',      // required if response_type = 'code'
        redirect_uri: 'https://www.google.com.br/',       // required - some dummy url
        other_params: {scope: 'basic_info', display: 'popup'}        // optional params object for scope, state, display...
    }, function(token, response){
        // do something with token or response
        // $("#logs").append("<p class='success'><b>access_token: </b>"+token+"</p>");
        // $("#logs").append("<p class='success'><b>response: </b>"+JSON.stringify(response)+"</p>");
        url_token = 'https://graph.facebook.com/me?access_token=' + token;
        $.get(url_token, function(data, status){

          // ***FEZ O LOGIN NO FACEBOOK E CONSEGUIU OBTER OS DADOS DO USUARIO
          if(status == 'success') {
            var user_obj = new Object();
            user_obj['name'] = data['name'];
            user_obj['id'] = data['id'];

            var user_JSON = JSON.stringify(user_obj);

            window.location.href = "app.html";

          }

          // NÃO CONSEGUIU OBTER OS DADOS DO USUÁRIO DO FACEBOOK
          else {
            alert('Erro na obtenção dos dados do usuário');
          }
        });


    }, function(error, response){
        // do something with error object
        $("#logs").append("<p class='error'><b>error: </b>"+JSON.stringify(error)+"</p>");
        $("#logs").append("<p class='error'><b>response: </b>"+JSON.stringify(response)+"</p>");
    });
}

